import React, { Component } from "react";
import "./App.css";
import { Container } from "reactstrap";
export class App extends Component {
  render() {
    return (
      <Container>
      <div>
        <form>
          <label>
            NAME:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="submit" />
        </form>
      </div>
      </Container>
    );
  }
}

export default App;

